import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './AddProperty.css';

function AddProperty() {
  const [formData, setFormData] = useState({
    title: '',
    description: '',
    price: '',
    location: '',
    bedrooms: '',
    bathrooms: '',
    furnished: false,
    amenities: [],
    imagePaths: [],
    videoPath: ''
  });
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    } else {
      setIsAuthenticated(true);
    }
  }, [navigate]);

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleAmenityChange = (e) => {
    const { value, checked } = e.target;
    setFormData(prevState => ({
      ...prevState,
      amenities: checked
        ? [...prevState.amenities, value]
        : prevState.amenities.filter(amenity => amenity !== value)
    }));
  };

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);
    const paths = files.map(file => URL.createObjectURL(file));
    setFormData(prevState => ({
      ...prevState,
      imagePaths: [...prevState.imagePaths, ...paths]
    }));
  };

  const handleVideoUpload = (e) => {
    const file = e.target.files[0];
    const path = URL.createObjectURL(file);
    setFormData(prevState => ({
      ...prevState,
      videoPath: path
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const response = await axios.post('http://localhost:5000/api/properties', formData, {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        }
      });
      console.log('Property added:', response.data);
      alert('Property added successfully! Please copy the image and video paths to store in your database.');
      navigate('/view-all-rooms');
    } catch (error) {
      console.error('Error adding property:', error);
      alert('Failed to add property. Please try again.');
    }
  };

  if (!isAuthenticated) {
    return null;
  }

  return (
    <div className="add-property-page">
      <header className="header">
        {/* Header content remains the same */}
      </header>

      <main className="add-property-content">
        <div className="container">
          <h1>Add Your Room</h1>
          <form onSubmit={handleSubmit} className="add-property-form">
            {/* Other form fields remain the same */}
            
            <div className="form-group">
              <label htmlFor="images">Upload Images</label>
              <input
                type="file"
                id="images"
                name="images"
                accept="image/*"
                multiple
                onChange={handleImageUpload}
              />
              {formData.imagePaths.map((path, index) => (
                <div key={index}>
                  <img src={path} alt={`Uploaded ${index + 1}`} style={{width: '100px', height: '100px'}} />
                  <p>Image Path: {path}</p>
                </div>
              ))}
            </div>
            <div className="form-group">
              <label htmlFor="video">Upload Video</label>
              <input
                type="file"
                id="video"
                name="video"
                accept="video/*"
                onChange={handleVideoUpload}
              />
              {formData.videoPath && (
                <div>
                  <video src={formData.videoPath} style={{width: '200px'}} controls />
                  <p>Video Path: {formData.videoPath}</p>
                </div>
              )}
            </div>
            <div className="button-group">
              <button type="submit" className="btn btn-primary">Add Property</button>
            </div>
          </form>
        </div>
      </main>

      <footer className="footer">
        {/* Footer content remains the same */}
      </footer>
    </div>
  );
}

export default AddProperty;
